import{_ as o,o as e,c as t,a as i}from"./app-ff2f634e.js";const l={},u=i("<p><strong>倾泠雪帝：</strong> golang中struct有tag，json都有哪些值</p><p><strong>Ai.小助手：</strong> 在Golang中，struct的tag可以用于标记字段的元数据，其中最常用的是用于JSON序列化和反序列化的tag。下面是一些常见的JSON tag：</p><ul><li><code>json:&quot;-&quot;</code>：将该字段忽略，不进行序列化和反序列化。</li><li><code>json:&quot;fieldName&quot;</code>：指定该字段在JSON中的名称。</li><li><code>json:&quot;,omitempty&quot;</code>：如果该字段为零值或空值，则忽略该字段。</li><li><code>json:&quot;fieldName,omitempty&quot;</code>：将该字段在JSON中的名称指定为fieldName，并在该字段为零值或空值时忽略该字段。</li><li><code>json:&quot;fieldName,string&quot;</code>：将该字段在JSON中的值转换为字符串类型。</li><li><code>json:&quot;fieldName,omitempty,string&quot;</code>：将该字段在JSON中的名称指定为fieldName，并将该字段在JSON中的值转换为字符串类型，并在该字段为零值或空值时忽略该字段。</li></ul><p>除了上面列举的常见JSON tag，还有其他一些可用的tag，如<code>json:&quot;,string&quot;</code>表示将所有字段的值都转换为字符串类型。</p><p><strong>倾泠雪帝：</strong> gorm的tag都有哪些，全部列出来</p><p><strong>Ai.小助手：</strong> GORM是一个Go语言的ORM库，支持MySQL、PostgreSQL、SQLite、SQL Server等多种数据库，它也有自己的一套tag规则。下面是一些常见的GORM tag：</p><ul><li><code>gorm:&quot;column:columnName&quot;</code>：指定字段在数据库中的列名。</li><li><code>gorm:&quot;primary_key&quot;</code>：将该字段设置为主键。</li><li><code>gorm:&quot;auto_increment&quot;</code>：将该字段设置为自增长。</li><li><code>gorm:&quot;not null&quot;</code>：将该字段设置为非空。</li><li><code>gorm:&quot;unique&quot;</code>：将该字段设置为唯一。</li><li><code>gorm:&quot;default:defaultValue&quot;</code>：指定该字段在数据库中的默认值。</li><li><code>gorm:&quot;size:255&quot;</code>：指定该字段在数据库中的大小。</li><li><code>gorm:&quot;type:varchar(100)&quot;</code>：指定该字段在数据库中的类型。</li><li><code>gorm:&quot;index&quot;</code>：为该字段创建索引。</li><li><code>gorm:&quot;uniqueIndex&quot;</code>：为该字段创建唯一索引。</li><li><code>gorm:&quot;embedded&quot;</code>：将该字段嵌入到父结构体中，即嵌入式结构体。</li><li><code>gorm:&quot;associationForeignKey:ForeignKey&quot;</code>：指定关联外键。</li></ul><p>除了上面列举的常见GORM tag，还有其他一些可用的tag，如<code>gorm:&quot;default:CURRENT_TIMESTAMP&quot;</code>表示将该字段在数据库中的默认值设置为当前时间戳。</p>",8),c=[u];function d(n,g){return e(),t("div",null,c)}const a=o(l,[["render",d],["__file","golangzhong，jsonhegorm tagdequzhi.html.vue"]]);export{a as default};
